const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre III", "p": 42}, {"t": "text", "c": ["- Parce que chez moi c\u2019est tout petit\u2026", "- \xC7a suffira s\xFBrement.", "Je t\u2019ai donn\xE9 un tout petit mouton."], "p": 42}, {"t": "text", "c": ["Il pencha la t\xEAte vers le dessin : - Pas si petit que \xE7a\u2026", "Tiens !", "Il s\u2019est endormi\u2026", "Et c\u2019est ainsi que je fis la connaissance du petit prince."], "p": 43}, {"t": "text", "c": ["Voil\xE0 le meilleur portrait que, plus tard, j\u2019ai r\xE9ussi \xE0 faire de lui. Il me fallut longtemps pour comprendre d\u2019o\xF9 il venait.", "Le petit prince, qui me posait beaucoup de questions, ne semblait jamais entendre les miennes.", "Ce sont des mots prononc\xE9s par hasard qui, peu \xE0 peu, m\u2019ont tout r\xE9v\xE9l\xE9.", "Ainsi, quand il aper\xE7ut pour la premi\xE8re fois mon avion (je ne dessinerai pas mon avion, c\u2019est un dessin beaucoup trop compliqu\xE9 pour moi) il me demanda :"], "p": 45}, {"t": "text", "c": ["- Qu\u2019est-ce que c\u2019est que cette chose-l\xE0 ?"], "p": 46}, {"t": "text", "c": ["- Ce n\u2019est pas une chose. \xC7a vole. C\u2019est un avion. C\u2019est mon avion. Et j\u2019\xE9tais fier de lui apprendre que je volais. Alors il s\u2019\xE9cria :"], "p": 48}, {"t": "text", "c": ["- Comment ! Tu es tomb\xE9 du ciel ?"], "p": 49}, {"t": "text", "c": ["- Oui, fis-je modestement."], "p": 50}, {"t": "text", "c": ["- Ah ! \xC7a c\u2019est dr\xF4le\u2026"], "p": 51}, {"t": "text", "c": ["Et le petit prince eut un tr\xE8s joli \xE9clat de rire qui m\u2019irrita beaucoup. Je d\xE9sire que l\u2019on prenne mes malheurs au s\xE9rieux.", "Puis il ajouta :"], "p": 52}, {"t": "text", "c": ["- Alors, toi aussi tu viens du ciel !", "De quelle plan\xE8te es-tu ?"], "p": 53}, {"t": "text", "c": ["J\u2019entrevis aussit\xF4t une lueur, dans le myst\xE8re de sa pr\xE9sence, et j\u2019interrogeai brusquement :"], "p": 54}, {"t": "text", "c": ["- Tu viens donc d\u2019une autre plan\xE8te ?"], "p": 55}, {"t": "text", "c": ["Mais il ne me r\xE9pondit pas. Il hochait la t\xEAte doucement tout en regardant mon avion :"], "p": 56}, {"t": "text", "c": ["- C\u2019est vrai que, l\xE0-dessus, tu ne peux pas venir de bien loin\u2026 Et il s\u2019enfon\xE7a dans une r\xEAverie qui dura longtemps. Puis, sortant mon mouton de sa poche, il se plongea dans la contemplation de son tr\xE9sor. Vous imaginez combien j\u2019avais pu \xEAtre intrigu\xE9 par cette demi-confidence sur \xAB les autres plan\xE8tes \xBB. Je m\u2019effor\xE7ai donc d\u2019en savoir plus long :"], "p": 58}, {"t": "text", "c": ["- D\u2019o\xF9 viens-tu, mon petit bonhomme ?", "O\xF9 est-ce \xAB chez toi \xBB ?", "O\xF9 veux-tu emporter mon mouton ?"], "p": 59}, {"t": "text", "c": ["Il me r\xE9pondit apr\xE8s un silence m\xE9ditatif :"], "p": 60}, {"t": "text", "c": ["- Ce qui est bien, avec la caisse que tu m\u2019as donn\xE9e, c\u2019est que, la nuit, \xE7a lui servira de maison."], "p": 61}, {"t": "text", "c": ["- Bien s\xFBr.", "Et si tu es gentil, je te donnerai aussi une corde pour l\u2019attacher pendant le jour. Et un piquet."], "p": 63}, {"t": "text", "c": ["La proposition parut choquer le petit prince :"], "p": 64}, {"t": "text", "c": ["- L\u2019attacher ? Quelle dr\xF4le d\u2019id\xE9e !"], "p": 65}, {"t": "text", "c": ["- Mais si tu ne l\u2019attaches pas, il ira n\u2019importe o\xF9, et il se perdra\u2026"], "p": 66}, {"t": "text", "c": ["Et mon ami eut un nouvel \xE9clat de rire : - Mais o\xF9 veux-tu qu\u2019il aille !"], "p": 68}, {"t": "text", "c": ["- N\u2019importe o\xF9. Droit devant lui\u2026 Alors le petit prince remarqua gravement :"], "p": 70}]}';export{e as default};
